      Hint: ExtendedContent
      Value: |
        <p>Kaytee Tube O'Hay is a safe to chew tube with delicious Kaytee Timothy Hay and carrots inside. Kaytee Timothy Hay is hand selected to ensure the long fiber strands and proper leaf to stem ratio to support digestive health. Kaytee Timothy Hay is grown in the ideal ecological location for moisture and climate control and is then stored in a protected environment to ensure the quality and superior nutritional value are maintained. Timothy Hay is ideal for animals over 7 months of age because it is higher in fiber to support digestive health and lower in protein and calcium than alfalfa hay to support urinary health.<br /> <br /> The experts who bring you Kaytee products understand how important your pet's health is to you. Kaytee Timothy Hay provides the nutrition your Rabbit, Guinea Pig or other small animals need and the quality you expect.</p> <p><a href="~/link.aspx?_id=EE11AD4E4BEB45858ECDDD45ECED39EB&amp;_z=z" target="_blank">Learn More About Kaytee Hay</a></p>
